import React from 'react';
import styled from 'styled-components';

const Title = styled.h1`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;

const Tomato1 = styled.div`
position: relative;
    width: 300px;
    height: 270px;
    background-color: $red;
    border: 10px solid darken($red, 10%);
    border-width: 4px 8px 10px 4px;
    border-radius: 90% 100%;
    animation: tomatoRoll 1s alternate infinite;
`;

class Tomato extends React.PureComponent {
    render() {
        return (
            <div><Tomato1 /><Title>TOMATO</Title></div>
        )
    }
}
export default Tomato;
